    override fun action(_localctx: RuleContext?, ruleIndex: Int, actionIndex: Int) {
        when (ruleIndex) {
            9 -> NATIVE_BLOCK_action(_localctx, actionIndex)
        }
    }

    private fun NATIVE_BLOCK_action(_localctx: RuleContext?, actionIndex: Int) {
        when (actionIndex) {
            0 -> {

                var braceCount = 1

                while (braceCount > 0) {
                    val nextChar = inputStream.LA(1)

                    if (nextChar == EOF) {
                        break
                    }

                    when (nextChar.toChar()) {
                        '{' -> braceCount++
                        '}' -> braceCount--
                        '\n' -> {
                            line++
                            charPositionInLine = -1 // set as -1 as it'll be incremented later
                        }
                    }

                    if (braceCount > 0) {
                        inputStream.consume()
                        charPositionInLine++
                    }
                }
                    
            }
        }
    }

